import "../Home.css";
import "bootstrap/dist/css/bootstrap.min.css";
import React, { useState } from "react";
import { Collapse, CardBody, Card } from "reactstrap";

import "../AppFaq.css";

import img from "../images/img.png";
import N from "../images/Frame.png";
//import FaqImg from "../images/FaqImg.png";
//import faqAmarelo from "../images/faqAmarelo.png";
import Vector from "../images/idioma.png";

import CetaBaixo from "../images/Vector.png";

function GoTokensNft() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-lg-4 col-md-12 col-sm-12">
          <div id="MaskGroup">
            <div className="GoTokens">
              <h2 style={{ fontWeight: "bold" }}>Go Tokens</h2>
            </div>
            <div className="NFT">
              <img src={N} className="img-fluid" style={{}} alt="" />
            </div>
            <div className="paragrafo" style={{ marginTop: "30px" }}>
              <p>Você conectado diretamente com seu fã</p>
            </div>
            <div className="botao">
              <a href="/GofundNFT">
                <button id="botaoComecar">Começar</button>
              </a>
            </div>
            <div className="RoleAbaixo">
              <p className="gradient">ROLE ABAIXO PARA SABER MAIS</p>
              <img
                src={CetaBaixo}
                className="img-fluid"
                style={{
                  height: "18px",
                  width: "17px",
                  marginLeft: "227px",
                  marginTop: "-65px",
                }}
                alt=""
              />
            </div>
          </div>
        </div>
        <div className="col-lg-1 col-md-0 col-sm-0"></div>

        <div className="col-lg-6 col-md-12 col-sm-12">
          <div id="MaskGroupLdireito">
            <img
              id="MaskGroupLdireitoImg"
              style={{ marginTop: "0px", marginLeft: "0px" }}
              src={img}
              className="img-fluid"
              alt="Gotokens"
            />
          </div>
          <BotaoFaq />
        </div>
      </div>
    </div>
  );
}

export default GoTokensNft;
/* O CSS DA FAQ ESTA EM UMA PASTA SEPADARA CHAMADA APPFAQ.CSS */

function BotaoFaq() {
  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => setIsOpen(!isOpen);

  return (
    <div className="container" id="EspaçoTelagrande">
      <div className="col-12">
        <button className="buttonFaq" onClick={toggle} style={{}}>
          <div id="fig">
            <img alt="" style={{ marginTop: "-10px" }} />
          </div>
        </button>

        <Collapse isOpen={isOpen}>
          <Card id="CardStyle">
            <CardBody id="CArdBodyStyle">
              <h4
                style={{
                  color: "#C8C8C8",
                  textAlign: "center",
                  marginTop: "40px",
                }}
              >
                Não Tenha Dúvidas
              </h4>
              <h2 style={{ color: "#717171", textAlign: "center" }}>
                Perguntas Frequentes
              </h2>
              <OqEtoken />
              <Tokenizaçao />
              <AtivosDigitaisl />
              <OqEnFT />
              <OqAtivoNfungivel />
              <QuemEmitirToken />
              <GoEmissorTokens />
              <PqEmitirToken />
              <SeguroComprarToken />
              <PqBlockchainSeguro />
              <ExisteRiscoComprarToken />
              <OndeGuardadoToken />
              <OqUmaWallet />
              <QualDiferencaWallet />
              <PqUsaraGoWallet />
              <OndEcriadoToken />
              <QuaisTiposTokens />
              <ElegalEmitirTokens />
              <QualVantagemCriarToken />
              <OqEgoTokens />
              <QueroEmitirUmToken />
              <QuantoTempoCriarToken />
              <QtipoTokensPodemSerCriados />
              <OquePrecisoCriarProprioToken />
              <OqEtokenEconomics />
              <QuantoCustaPcriarMeuToken />
              <ExisteCustoPcompradorToken />
              <OqueFazUmBanco />
              <QuaisServiçosUmBancoOferece />
            </CardBody>
          </Card>
        </Collapse>
      </div>
    </div>
  );
}

function Tokenizaçao() {
  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => setIsOpen(!isOpen);

  return (
    <section className="mb-4">
      <div className="FaqDiv">
        <button
          className="faqbutton"
          onClick={toggle}
          style={{ marginBottom: "1rem" }}
        >
          <h5 style={{ marginTop: "20px" }}>O que é tokenização?</h5>
        </button>
        <img
          onClick={toggle}
          style={{ cursor: "pointer" }}
          alt=""
          src={Vector}
        ></img>

        <Collapse isOpen={isOpen}>
          <Card
            style={{
              boxShadow: "none",
              borderRadius: "20px",
              border: "none",
              height: "100%",
            }}
          >
            <CardBody>
              <p>
                É transformar um ativo físico em formato digital, através de um
                processo conhecido como “Tokenização”. O emissor dos tokens pode
                dividir um ativo em parcelas menores, aumentando sua liquidez ao
                poder movimentar frações do ativo. Já o detentor dos tokens
                conta com a segurança, transparência e autonomia conferida pela
                tecnologia utilizada na tokenização, a blockchain (banco de
                dados descentralizado). Por conta das características de
                funcionamento da Blockchain, os processos de transferência e o
                registro da posse de um token são simplificados.
              </p>

              <p>
                {" "}
                Esta é uma tendência e já existem muitos ativos sendo negociados
                em forma de tokens. Um exemplo recente são os NFT - Non fungible
                tokens que representam obras de arte digitais. É possível
                tokenizar um imóvel, um título precatório e negociá-los.
              </p>

              <p>
                Uma outra prova de sucesso da estratégia de tokenização é a
                intenção dos Bancos Centrais e governos de tokenizar suas moedas
                fiduciárias. Isto já está em testes na China e o Banco Central
                do Brasil já sinalizou esta intenção também.
              </p>

              <p>
                A tokenização facilita a transferência e o registro da posse de
                um bem, por conta das características de funcionamento da
                blockchain.
              </p>
            </CardBody>
          </Card>
        </Collapse>
      </div>
    </section>
  );
}

function OqEtoken() {
  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => setIsOpen(!isOpen);

  return (
    <section className="mb-4">
      <div className="FaqDiv">
        <button
          className="faqbutton"
          onClick={toggle}
          style={{ marginBottom: "1rem" }}
        >
          <h5 style={{ marginTop: "20px" }}>Mas, o que é um token?</h5>
        </button>
        <img
          onClick={toggle}
          style={{ cursor: "pointer" }}
          alt=""
          src={Vector}
        ></img>

        <Collapse isOpen={isOpen}>
          <Card
            style={{
              boxShadow: "none",
              borderRadius: "20px",
              border: "none",
              height: "100%",
            }}
          >
            <CardBody>
              <p>O token é um registro digital.</p>
              <p>
                É a representação digital de algo que existe no mundo real, ou
                seja o token representa um ativo base como por exemplo
              </p>
              <ul>
                <li>
                  <p>cotas de uma empresa, </p>
                </li>
                <li>
                  <p>um imóvel,</p>
                </li>
                <li>
                  <p>uma obra de arte, </p>
                </li>
                <li>
                  <p>
                    direitos de recebimentos futuros como valores a receber de
                    um youtuber,{" "}
                  </p>
                </li>
                <li>
                  <p>pontos de fidelidade</p>
                </li>
                <li>
                  <p>aluguéis, e muitos outros exemplos. </p>
                </li>
              </ul>
              <p>
                Praticamente tudo que existe física e digitalmente e tem um
                valor, pode ser digitalizado na forma de um token.
              </p>
              <p>
                Você pode criar um token para arrecadar doações com a vantagem
                de poder fazer isso pelo mundo todo.
              </p>
            </CardBody>
          </Card>
        </Collapse>
      </div>
    </section>
  );
}

function AtivosDigitaisl() {
  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => setIsOpen(!isOpen);

  return (
    <section className="mb-4">
      <div className="FaqDiv">
        <button
          className="faqbutton"
          onClick={toggle}
          style={{ marginBottom: "1rem" }}
        >
          <h5 style={{ marginTop: "20px" }}>
            Ativos digitais podem ser tokenizados?
          </h5>
        </button>
        <img
          onClick={toggle}
          style={{ cursor: "pointer" }}
          alt=""
          src={Vector}
        ></img>

        <Collapse isOpen={isOpen}>
          <Card
            style={{
              boxShadow: "none",
              borderRadius: "20px",
              border: "none",
              height: "100%",
            }}
          >
            <CardBody>
              <p>Sim. Itens digitais também podem ser tokenizados. </p>
            </CardBody>
          </Card>
        </Collapse>
      </div>
    </section>
  );
}

function OqEnFT() {
  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => setIsOpen(!isOpen);

  return (
    <section className="mb-4">
      <div className="FaqDiv">
        <button
          className="faqbutton"
          onClick={toggle}
          style={{ marginBottom: "1rem" }}
        >
          <h5 style={{ marginTop: "20px" }}>O que é NFT?</h5>
        </button>
        <img
          onClick={toggle}
          style={{ cursor: "pointer" }}
          alt=""
          src={Vector}
        ></img>

        <Collapse isOpen={isOpen}>
          <Card
            style={{
              boxShadow: "none",
              borderRadius: "20px",
              border: "none",
              height: "100%",
            }}
          >
            <CardBody>
              <p>
                NFT quer dizer “non fungeble token”. Este tipo de token
                representa um ativo base ÚNICO que não é fungível.{" "}
              </p>
            </CardBody>
          </Card>
        </Collapse>
      </div>
    </section>
  );
}

function OqAtivoNfungivel() {
  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => setIsOpen(!isOpen);

  return (
    <section className="mb-4">
      <div className="FaqDiv">
        <button
          className="faqbutton"
          onClick={toggle}
          style={{ marginBottom: "1rem" }}
        >
          <h5 style={{ marginTop: "20px" }}>O que é ativo não fungível?</h5>
        </button>
        <img
          onClick={toggle}
          style={{ cursor: "pointer" }}
          alt=""
          src={Vector}
        ></img>

        <Collapse isOpen={isOpen}>
          <Card
            style={{
              boxShadow: "none",
              borderRadius: "20px",
              border: "none",
              height: "100%",
            }}
          >
            <CardBody>
              <p>
                Uma nota de cem reais é um ativo fungível pois outra nota de cem
                reais pode ser entregue no lugar da primeira pois possui o mesmo
                valor. Já um quadro, uma obra de arte, seja ela física ou
                digital é única e não pode ser trocada por outra pois não existe
                uma outra igual.{" "}
              </p>
            </CardBody>
          </Card>
        </Collapse>
      </div>
    </section>
  );
}

function QuemEmitirToken() {
  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => setIsOpen(!isOpen);

  return (
    <section className="mb-4">
      <div className="FaqDiv">
        <button
          className="faqbutton"
          onClick={toggle}
          style={{ marginBottom: "1rem" }}
        >
          <h5 style={{ marginTop: "20px" }}>Quem pode emitir um token?</h5>
        </button>
        <img
          onClick={toggle}
          style={{ cursor: "pointer" }}
          alt=""
          src={Vector}
        ></img>

        <Collapse isOpen={isOpen}>
          <Card
            style={{
              boxShadow: "none",
              borderRadius: "20px",
              border: "none",
              height: "100%",
            }}
          >
            <CardBody>
              <p>
                Qualquer pessoa ou empresa que detenha do direito sobre o ativo
                base que está sendo tokenizado, pode ser o emissor de um token.
                Emissores são responsáveis pela definição das regras de emissão,
                distribuição, utilização e até eliminação do token.
              </p>
            </CardBody>
          </Card>
        </Collapse>
      </div>
    </section>
  );
}

function GoEmissorTokens() {
  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => setIsOpen(!isOpen);

  return (
    <section className="mb-4">
      <div className="FaqDiv">
        <button
          className="faqbutton"
          onClick={toggle}
          style={{ marginBottom: "1rem" }}
        >
          <h5 style={{ marginTop: "20px" }}>O GoTokens é emissor de tokens?</h5>
        </button>
        <img
          onClick={toggle}
          style={{ cursor: "pointer" }}
          alt=""
          src={Vector}
        ></img>

        <Collapse isOpen={isOpen}>
          <Card
            style={{
              boxShadow: "none",
              borderRadius: "20px",
              border: "none",
              height: "100%",
            }}
          >
            <CardBody>
              <p>
                Não. O GoTokens é um produto criado pela GoLabs, frente de
                produtos da GoBlockchain que facilita a emissão de tokens pelos
                seus clientes, os verdadeiros emissores de tokens. .{" "}
              </p>
            </CardBody>
          </Card>
        </Collapse>
      </div>
    </section>
  );
}
function PqEmitirToken() {
  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => setIsOpen(!isOpen);

  return (
    <section className="mb-4">
      <div className="FaqDiv">
        <button
          className="faqbutton"
          onClick={toggle}
          style={{ marginBottom: "1rem" }}
        >
          <h5 style={{ marginTop: "20px" }}>Porque emitir um token?</h5>
        </button>
        <img
          onClick={toggle}
          style={{ cursor: "pointer" }}
          alt=""
          src={Vector}
        ></img>

        <Collapse isOpen={isOpen}>
          <Card
            style={{
              boxShadow: "none",
              borderRadius: "20px",
              border: "none",
              height: "100%",
            }}
          >
            <CardBody>
              <p>
                Ao emitir um token você pode fracionar um o ativo objeto em
                partes menores, aumentando a liquidez ao poder movimentar as
                frações desse ativo objeto.
              </p>

              <p>
                Imagine uma barra de ouro com 1kg. Se você quiser vender essa
                barra de ouro precisará encontrar um comprador que possa
                compra-la por inteiro e pagar por 1kg de ouro. Agora imagine que
                você possa vender esta mesma barra de ouro em 1.000 partes de 1g
                cada. Será bem mais fácil encontrar compradores não é mesmo?
              </p>
            </CardBody>
          </Card>
        </Collapse>
      </div>
    </section>
  );
}
function SeguroComprarToken() {
  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => setIsOpen(!isOpen);

  return (
    <section className="mb-4">
      <div className="FaqDiv">
        <button
          className="faqbutton"
          onClick={toggle}
          style={{ marginBottom: "1rem" }}
        >
          <h5 style={{ marginTop: "20px" }}>É seguro comprar um token? </h5>
        </button>
        <img
          onClick={toggle}
          style={{ cursor: "pointer" }}
          alt=""
          src={Vector}
        ></img>

        <Collapse isOpen={isOpen}>
          <Card
            style={{
              boxShadow: "none",
              borderRadius: "20px",
              border: "none",
              height: "100%",
            }}
          >
            <CardBody>
              <p>
                Como toda operação de compra e venda, estamos falando de uma
                relação entre comprador e vendedor. Você precisa entender o que
                está comprando. Porém ao comprar um token, você conta com a
                segurança, transparência e autonomia conferida pela tecnologia
                blockchain utilizada na tokenização. Por conta das
                características de funcionamento da Blockchain, os processos de
                aquisição, transferência e registro da posse de um token são
                transparentes e seguros. Uma grande vantagem das redes
                blockchain é que a posse do token é sua. Você mesmo pode
                custodiar o seu token e não depender de terceiros para prestar
                esse serviço.{" "}
              </p>
            </CardBody>
          </Card>
        </Collapse>
      </div>
    </section>
  );
}
function PqBlockchainSeguro() {
  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => setIsOpen(!isOpen);

  return (
    <section className="mb-4">
      <div className="FaqDiv">
        <button
          className="faqbutton"
          onClick={toggle}
          style={{ marginBottom: "1rem" }}
        >
          <h5 style={{ marginTop: "20px" }}>Por que blockchain é seguro?</h5>
        </button>
        <img
          onClick={toggle}
          style={{ cursor: "pointer" }}
          alt=""
          src={Vector}
        ></img>

        <Collapse isOpen={isOpen}>
          <Card
            style={{
              boxShadow: "none",
              borderRadius: "20px",
              border: "none",
              height: "100%",
            }}
          >
            <CardBody>
              <p>
                O que chamamos de blockchain é na verdade um conjunto de
                tecnologias que reunidas formam uma rede que pode ser entendida
                como um grande banco de dados descentralizado onde muitos fazem
                o controle da rede dispensando um intermediário para controlar
                ou garantir o funcionamento e segurança do protocolo da rede. A
                rede tem suas regras garantidas por um protocolo que funciona
                autonomamente e burlar estas regras exigiria um esforço
                inimaginável sendo muito mais vantajoso agir em prol do
                funcionamento da rede.{" "}
              </p>
            </CardBody>
          </Card>
        </Collapse>
      </div>
    </section>
  );
}
function ExisteRiscoComprarToken() {
  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => setIsOpen(!isOpen);

  return (
    <section className="mb-4">
      <div className="FaqDiv">
        <button
          className="faqbutton"
          onClick={toggle}
          style={{ marginBottom: "1rem" }}
        >
          <h5 style={{ marginTop: "20px" }}>
            Existe risco ao comprar um token?
          </h5>
        </button>
        <img
          onClick={toggle}
          style={{ cursor: "pointer" }}
          alt=""
          src={Vector}
        ></img>

        <Collapse isOpen={isOpen}>
          <Card
            style={{
              boxShadow: "none",
              borderRadius: "20px",
              border: "none",
              height: "100%",
            }}
          >
            <CardBody>
              <p>
                Como toda operação de compra e venda existe riscos. Você precisa
                entender o que está comprando e os riscos existentes. O emissor
                do token deve deixar claro quais são os riscos inerentes ao seu
