function OqueFazUmBanco() {
  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => setIsOpen(!isOpen);

  return (
    <section className="mb-4">
      <div className="FaqDiv">
        <button
          className="faqbutton"
          onClick={toggle}
          style={{ marginBottom: "1rem" }}
        >
          <h5 style={{ marginTop: "20px" }}>O que faz um banco?</h5>
        </button>
        <img
          onClick={toggle}
          style={{ cursor: "pointer" }}
          alt=""
          src={Vector}
        ></img>

        <Collapse isOpen={isOpen}>
          <Card
            style={{
              boxShadow: "none",
              borderRadius: "20px",
              border: "none",
              height: "100%",
            }}
          >
            <CardBody>
              <p>
                No modelo tradicional um banco custodia o seu dinheiro numa
                CONTA CORRENTE (depósito a vista) e oferece MEIOS DE PAGAMENTO
                para você movimentar a sua conta (utilize o dinheiro depositado
                nela).
              </p>
            </CardBody>
          </Card>
        </Collapse>
      </div>
    </section>
  );
}

function QuaisServiçosUmBancoOferece() {
  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => setIsOpen(!isOpen);

  return (
    <section className="mb-4">
      <div className="FaqDiv">
        <button
          className="faqbutton"
          onClick={toggle}
          style={{ marginBottom: "1rem" }}
        >
          <h5 style={{ marginTop: "20px" }}>
            Quais serviços um banco oferece?
          </h5>
        </button>
        <img
          onClick={toggle}
          style={{ cursor: "pointer" }}
          alt=""
          src={Vector}
        ></img>

        <Collapse isOpen={isOpen}>
          <Card
            style={{
              boxShadow: "none",
              borderRadius: "20px",
              border: "none",
              height: "100%",
            }}
          >
            <CardBody>
              <p>
                Basicamente um banco oferece, além do SERVIÇO de custódia (do
                seu dinheiro) e meios de pagamento para você utilizar o seu
                dinheiro, produtos de CRÉDITO (dinheiro para você) em troca de
                JUROS (dinheiro para o banco) bem como alternativas de
                INVESTIMENTO (dinheiro para o banco) em troca de RENTABILIDADE
                (dinheiro para você).
              </p>

              <p>
                No fim das contas, um banco tradicional oferece o serviço de{" "}
              </p>

              <ul>
                <li>
                  <p>
                    custódia para manter o seu dinheiro com ele em troca de
                    segurança,{" "}
                  </p>
                </li>
                <li>
                  <p>crédito e </p>
                </li>
                <li>
                  <p>rentabilidade. </p>
                </li>
              </ul>

              <p>Porém, você não é realmente dono do seu dinheiro. </p>
            </CardBody>
          </Card>
        </Collapse>
      </div>
    </section>
  );
}
